#include <stdexcept>
#include <vector>
#include <stdio.h>
#include <stdlib.h>
#include "pack109.hpp"

template <class T>
int test(const char* label, T lhs, T rhs) {
	printf("%s: ", label);
	if (lhs == rhs) {
		printf("Passed\n");
		return 1;
	} else {
		printf("Failed\n");
		printf("  lhs=%llx\n", lhs);
		printf("  rhs=%llx\n", rhs);
		exit(1);
	}
}

int testvec(const char* label, vec lhs, vec rhs) {
	printf("%s: ", label);
	if (lhs == rhs) {
		printf("Passed\n");
		return 1;
	} else {
		printf("Failed\n");
		printf("  lhs="); pack109::printVec(lhs); printf("\n");
		printf("  rhs="); pack109::printVec(rhs); printf("\n");
		exit(1);
	}
}

