	// Test bool
	// True
	{
		vec vt{0xa0};
		vec bytes = pack109::serialize(true);
		testvec("Test 1 - true ser", bytes, vt);

		bool deserVal = pack109::deserialize_bool(bytes);
		test("Test 2 - true de", deserVal, true);
	}

